    //信用卡续卡
    CreditApply.prototype.renewalCard = function (creditCardNum) {
        var _this = this;
        var param = {
            agreementId: "",
            creditCardNum: creditCardNum
        };
        this.creditCcmService.queryCreditResultInfoByAcctNo(param).subscribe(function (data) {
            if (data.returnCode.code == 'success') {
                if (data.creditResultList && data.creditResultList[0]) {
                    if (!(data.creditResultList[0].statusId == '1' || data.creditResultList[0].statusId == '2')) {
                        _this.msgs = [{ severity: 'error', summary: '', detail: '该卡状态异常，不能办理该业务' }];
                        return;
                    }
                    _this.communicationService.custRequestNo.emit({ creditCardNum: _this.creditCardNum });
                    _this.applymoney = _this.commfunc.formatMoney(data.total, 2);
                    _this.creditBarCode = data.creditResultList[0].creditBarCode;
                    _this.creditResultInfoBean.creditBarCode = data.creditResultList[0].creditBarCode;
                    _this.inputValues = data.creditResultList[0].custRequestId;
                    _this.creditResultInfoBean.startDate = new Date(data.creditResultList[0].endDate);
                    _this.starteDate = new Date(data.creditResultList[0].endDate);
                    if (!_this.endDates) {
                        _this.endDates = moment__WEBPACK_IMPORTED_MODULE_13__(_this.starteDate).add(5, 'year').format('Y-MM-DD');
                    }
                    _this.custRequestNoFromScardGetMcard = data.creditResultList[0].custRequestId;
                    _this.barCode = data.creditResultList[0].creditBarCode;
                    _this.handleDynamicProduct(data.resultList);
                }
                else {
                    _this.maskLayer = false;
                    _this.msgs = [{ severity: 'info', summary: '', detail: '暂无数据' }];
                }
            }
            else {
                _this.maskLayer = false;
                _this.msgs = [{ severity: 'error', summary: '提示', detail: data.returnCode.message }];
            }
        });
    };
