    //资金来源、贷款备注不能有经营投资等字眼
    CreditApply.prototype.checkup = function (value, i) {
        var regs = /房|车库|车位|商铺|铺位|摊位/g;
        if (value && value.match(regs)) {
            this.msgs = [{ severity: 'info', summary: '', detail: '当前借款用途不符合监管要求，请确认合规性' }];
            i == 1 ? this.creditResultInfoBean.repayAmtQuarry = value.replace(regs, '') : this.createApplyBean.loanUseRemark = value.replace(regs, '');
        }
        if (this.loanFlag) {
            var reg = /经营|投资|工资/g;
            if (value && value.match(reg)) {
                this.msgs = [{ severity: 'info', summary: '', detail: '还款资金来源与贷款备注中不能包含"经营、投资"等词语' }];
                i == 1 ? this.creditResultInfoBean.repayAmtQuarry = value.replace(reg, '') : this.createApplyBean.loanUseRemark = value.replace(reg, '');
            }
        }
        if (i == 2) {
            if (this.cont > 0) {
                this.islvs = true;
                var taskTypeQryByIndName = JSON.parse(this.commfunc.getSessionDataCH('taskTypeQryByIndName'));
                if (taskTypeQryByIndName.length == 0) {
                    this.msgs = [{ severity: 'error', summary: '错误：', detail: '客户信息不完整，请录入' }];
                    this.islvs = false;
                    return;
                }
                var pams = {
                    loanUser: value,
                    loanPurpuse4: taskTypeQryByIndName[0]['taskTypeId'],
                    loanPurpuse3: taskTypeQryByIndName[1]['taskTypeId'],
                    loanPurpuse2: taskTypeQryByIndName[2]['taskTypeId'],
                    loanPurpuse1: taskTypeQryByIndName[3]['taskTypeId'],
                };
                this.getGreenLoanList(pams);
            }
        }
    };
