    CreditApply.prototype.docheck = function (param) {
        //只有在非转化贷款的时候才进行判断
        if (!this.transform_flag && !this.transform_money) {
            if (param != '' && param != null && param != undefined) {
                // var regAmt = /^[0-9]*$/;
                var regAmt = /^[0-9]{1,}[.]{0,}[0-9]{0,}$/;
                var money = param.replace(/\,/g, '');
                if (!regAmt.test(money)) {
                    this.msgs = [];
                    this.msgs.push({ severity: 'error', summary: '提示', detail: '申请金额输入格式有误！' });
                    return;
                }
                // 校验金额上下限
                if (Number(money) < Number(this.minJe)) {
                    this.msgs = [];
                    this.msgs.push({ severity: 'error', summary: '提示', detail: '申请金额最低金额不能低于' + this.minJe + '!' });
                    return;
                }
                if (Number(money) > Number(this.maxJe)) {
                    this.msgs = [];
                    this.msgs.push({ severity: 'error', summary: '提示', detail: '申请金额最高金额不能高于' + this.maxJe + '!' });
                    return;
                }
            }
        }
        if (this.commfunc.getSessionDataCH('saveMSGIdentyfy') && this.commfunc.getSessionDataCH('saveMSGIdentyfy') == 'true') {
            this.commfunc.clearSession('saveMSGIdentyfy');
        }
    };
