    CreditApplyCard.prototype.query = function () {
        var _this = this;
        if (this.data.transferCreditData.varMap.dataMap['taskType'] == '11' && this.data.transferCreditData['taskType'] != 'approve') {
            this.istransform = true;
        }
        //检测是否为房地产企业
        this.isRealEstate = this.data.transferCreditData['custName'].match(/房地产|置业|房产/g) ? true : false;
        this.maskLayer1 = true;
        // // 
        var promise = new Promise(function (resolve) {
            // 查询客户信息
            _this.queryCustNeedInfo(resolve);
        }).then(function (res) {
            if (_this.data && _this.data.transferCreditData.varMap.dataMap['taskType'] == '02') {
                if (_this.data.transferCreditData.varMap.dataMap.cardNo) {
                    _this.creditCardNum = _this.data.transferCreditData.varMap.dataMap.cardNo;
                    _this.creditResultInfoBean.creditCardNum = _this.creditCardNum;
                }
                if (_this.data.transferCreditData.varMap.dataMap.acountNo) {
                    _this.creditCardNum = _this.data.transferCreditData.varMap.dataMap.acountNo;
                }
                else {
                    _this.creditCardNum = _this.data.transferCreditData.varMap.cardNo;
                }
                _this.creditResultInfoBean.creditCardNum = _this.creditCardNum;
                // this.creditResultInfoBean.creditCardNum = this.data.transferCreditData.varMap.dataMap.acountNo;
                _this.isxk = true;
                _this.isxks = false;
                _this.renewalCard(_this.creditResultInfoBean.creditCardNum);
            }
            else {
                _this.querySomething(); //查询自动扣款账号
            }
            _this.selectCustGroupVal();
        });
        if (this.data.transferCreditData['isPreview']) {
            return;
        }
        var commonHeader = JSON.parse(this.commfunc.getSessionData('commonHeader'));
        var chName = JSON.parse(this.commfunc.getSessionDataCH('chName'));
        this.tellerOrgName = chName.orgName;
        this.tellerOrgNo = commonHeader.orgId;
        this.investiGatorName = chName.userName;
        this.investiGatorId = commonHeader.userId;
        // 十级清分状态
        this.queryTenLeven('2');
        // 申请条形码
        // this.getApplyBarCode();
        // 数据字典码值 
        this.getCodeValues();
    };
