    CreditGuaranteeComponent.prototype.getBusinessHappenTypeValue = function (custRequestNo) {
        var _this = this;
        debugger;
        var param = {
            'custRequestNo': custRequestNo,
        };
        this.creditCcmService.dynamicProductQuery(param).subscribe(function (data) {
            if (data.returnCode.code == 'success') {
                if (data.dynamicProductValue) {
                    // 主担保方式为001-信用并且辅担保方式为001-信用，不显示担保信息tab页
                    if (_this.creditDetail.guaranteeType === '001' &&
                        (!_this.creditDetail.assistGuaranteeType || _this.creditDetail.assistGuaranteeType === '001')) {
                        _this.guaranteeFlag = false;
                    }
                    else {
                        _this.guaranteeFlag = true;
                        _this.displayNewBtn = true;
                        if (_this.creditDetail.businessType && _this.creditDetail.businessType === '06') {
                            _this.importBtnFlag = false;
                        }
                        else {
                            if (data.dynamicProductValue['PCA0000023'] === '01' || data.dynamicProductValue['PCA0000023'] === '06') {
                                _this.importBtnFlag = false;
                            }
                            else {
                                _this.importBtnFlag = true;
                            }
                        }
                        // let scardFlag = data.dynamicProductValue['PCA0000199'] === '2' ? true : false;
                        // 担保引用合同类型 01-普通 02-最高额 03-引用最高额 04-引用互助担保基金协议 05-引用批量授信最高额
                        switch (data.dynamicProductValue['PCA0000023']) {
                            case '01':
                                _this.toChildData['contractMode'] = '01';
                                break;
                            case '02':
                                _this.toChildData['contractMode'] = '02';
                                break;
                            case '03':
                                _this.toChildData['contractMode'] = '03';
                                break;
                            case '04':
                                _this.toChildData['contractMode'] = '04';
                                break;
                            case '05':
                                _this.toChildData['contractMode'] = '05';
                                break;
                            default:
                                _this.toChildData['contractMode'] = '';
                                break;
                        }
                    }
                }
            }
            else {
                _this.msgs = [];
                _this.msgs.push({ severity: 'error', summary: '错误', detail: data.returnCode.message });
                _this.guaranteeFlag = false;
            }
        });
    };
