    // 任务类型为信用卡，引用按钮隐藏（01是直销）
    CreditGuaranteeComponent.prototype.query = function (item) {
        if (item == '10' || item == '01') {
            this.importBtnFlag = false;
        }
        if (item == '10' || item == '02' || item == '16') { //10和02(卡要素,16是信用卡直销和信用卡续卡)
            this.importBtnFlags = true;
        }
        if (item === 'creditEntrance') {
            // 查询授信申请详情
            this.queryGuaranteeDetail();
        }
        if (item === 'creditGuaranteeEntrance') {
            this.importBtnFlags = true;
            // 卡要素-隐藏引用按钮
            this.importBtnFlag = false;
            if (this.kysGuaranteeFlag) {
                this.guaranteeFlag = true;
            }
            else {
                this.guaranteeFlag = false;
            }
        }
        // 360卡要素发起不进入此判断
        if (!this.inValue['creditCardElement']) {
            if (this.data.transferCreditData['taskType'] && this.data.transferCreditData['taskType'] == 'approve') {
                this.isApprove = false;
            }
            else {
                this.isApprove = true;
            }
        }
        else {
            if (this.inValue['operate'] == 'detail') {
                this.isApprove = false;
            }
        }
        // 初始化查询
        this.getCodeValues();
        if (this.scardFlag) {
            //只申请附卡时调用
            this.count++;
            if (this.count == 1) {
                this.oldcustRequestNo = this.custRequestNoFromScardGetMcard;
                this.onlyScardGuarantor();
            }
        }
        else {
            //查询担保
            this.queryFacQuestions_getGuarantor();
            //查询抵押、质押
            this.queryFacQuestions_getMortgage();
            this.queryFacQuestions_getPledge();
            //存单质押 added by yuanzhenghe20190415
            debugger;
            this.queryFacQuestions_getPledgeDeposit();
        }
    };
